import React, { useState } from 'react';
import './App.css';

function App() {
  const [currentStep, setCurrentStep] = useState(1);
  const [userId, setUserId] = useState(null);

  return (
    <div className="App">
      <header className="App-header">
        <h1>ðŸŽ¯ Zealthy Onboarding</h1>
        <div className="progress-bar">
          <div className={`step ${currentStep >= 1 ? 'active' : ''}`}>1</div>
          <div className={`step ${currentStep >= 2 ? 'active' : ''}`}>2</div>
          <div className={`step ${currentStep >= 3 ? 'active' : ''}`}>3</div>
        </div>

        {currentStep === 1 && (
          <div className="step-content">
            <h2>Step 1: Create Account</h2>
            <form className="onboarding-form">
              <input type="email" placeholder="Email" required />
              <input type="password" placeholder="Password" required />
              <button type="submit">Next Step â†’</button>
            </form>
          </div>
        )}

        {currentStep === 2 && (
          <div className="step-content">
            <h2>Step 2: Tell Us About Yourself</h2>
            <p>Dynamic components will appear here based on admin configuration</p>
            <button onClick={() => setCurrentStep(3)}>Next Step â†’</button>
          </div>
        )}

        {currentStep === 3 && (
          <div className="step-content">
            <h2>Step 3: Almost Done!</h2>
            <p>More dynamic components here</p>
            <button onClick={() => alert('Complete!')}>Complete Registration</button>
          </div>
        )}

        <div className="navigation">
          <nav>
            <a href="/admin">Admin Dashboard</a> | 
            <a href="/data">View Data</a>
          </nav>
        </div>
      </header>
    </div>
  );
}

export default App;
